import React, { useState } from 'react'
import { DropListTitle } from '../../components/DropList/DropList'
import { DropListBody } from '../../components/DropList/DropList'

type DropListAutoPropsType = {
    title: string
    one: string
    two: string
    three: string
    four: string
    five: string
}
export function DropListAuto(props: DropListAutoPropsType) {
    let [kukozha, setKukozha] = useState(false)
    return (
        <div>
            <DropListTitle value={props.title} />
            <DropListBody
                one={props.one}
                two={props.two}
                three={props.three}
                four={props.four}
                five={props.five} />
            <button>Kukozha</button>
        </div>
    )
}
